frontApp.controller("categoryPostController",["$scope","$http","$window","CategoryPost",function(n,t){n.categoryPosts=[];n.posts=[];n.idCategory=angular.element("#idCategory").val();t.get("/API/CategoriesAPI?att=idCategoryParent&&value="+n.idCategory).success(function(t){n.categoryPosts=t});t.get("/API/PostsAPI?att=idCategory&&value="+n.idCategory).success(function(t){n.posts=t})}]);